import React from 'react';
import { useSelector } from 'react-redux';
const FieldCard = ({ field }) => {
    //const field = useSelector((state) => state.fieldReducer)
    return (
        <li class="field_card" key={field._id}>
            {field.green}
        </li>
    );
};

export default FieldCard;
